//React library allows JSX
import React from 'react';
//ReactDom allows rendering to a browser
import ReactDOM from 'react-dom';
//import Card
import Card from './Card';

//import {robots} from robots.js as data
import {robots} from './robots';

//tachyons is a library I need to install and import - it allows for shortcuts in element formatting - I use it in the Card.js file.
import * as serviceWorker from './serviceWorker';

//rendering Cards (see Card.js) from the CardList component (see CardList.js) and assigning the property {robots}
ReactDOM.render(<Card 
	key={robots[0].username}
	name={robots[0].name}
	email={robots[0].email}
	/>,
	document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
